import React from 'react';
//mport Fitbit from './fitbit';
import classes from'./App.module.css';

function App() {




  return (


    <div className={classes.AppHeader} >
<nav className={classes.Topbar}>
<img src="png/fit_band_pink.png"  className={classes.logo.fitbit-imge-logo} />
<span className={classes.logo_text}>GearOS</span>

<button type="button" className={classes.login-btn}>Login</button>
</nav>

</div>

  );
}

export default App;
